gQM(){return"\u041f\u0430\u043f\u0438\u0440\u0443\u0441 115 \u0432 \u043d\u0430\u0441\u0442\u043e\u044f\u0449\u0435\u0435 \u0432\u0440\u0435\u043c\u044f \u0445\u0440\u0430\u043d\u0438\u0442\u0441\u044f \u0432 \u041c\u0443\u0437\u0435\u0435 \u042d\u0448\u043c\u043e\u043b\u0430 \u0432 \u041e\u043a\u0441\u0444\u043e\u0440\u0434\u0435, \u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f."},
