gSF(){return"\u0421\u0438\u043d\u0430\u0439\u0441\u043a\u0438\u0439 \u043a\u043e\u0434\u0435\u043a\u0441 \u043d\u0430\u043f\u0438\u0441\u0430\u043d \u043d\u0430 \u043f\u0435\u0440\u0433\u0430\u043c\u0435\u043d\u0442\u0435 (vellum), \u0438\u0437\u0433\u043e\u0442\u043e\u0432\u043b\u0435\u043d\u043d\u043e\u043c \u043f\u0440\u0435\u0438\u043c\u0443\u0449\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e \u0438\u0437 \u0442\u0435\u043b\u044f\u0447\u044c\u0435\u0439 \u043a\u043e\u0436\u0438 (\u0441 \u043d\u0435\u0437\u043d\u0430\u0447\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u043c \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d\u0438\u0435\u043c \u043e\u0432\u0435\u0447\u044c\u0435\u0439). \u0418\u0437\u043d\u0430\u0447\u0430\u043b\u044c\u043d\u043e \u043e\u043d \u0441\u043e\u0437\u0434\u0430\u0432\u0430\u043b\u0441\u044f \u043d\u0430 \u0434\u0432\u043e\u0439\u043d\u044b\u0445 \u043b\u0438\u0441\u0442\u0430\u0445, \u043f\u0440\u0435\u0434\u043f\u043e\u043b\u043e\u0436\u0438\u0442\u0435\u043b\u044c\u043d\u043e \u0440\u0430\u0437\u043c\u0435\u0440\u043e\u043c \u043e\u043a\u043e\u043b\u043e 40 \xd7 70 \u0441\u043c. \u0427\u0430\u0441\u0442\u044c \u043a\u043e\u0434\u0435\u043a\u0441\u0430, \u0445\u0440\u0430\u043d\u044f\u0449\u0430\u044f\u0441\u044f \u0432 \u0411\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u043e\u0439 \u0431\u0438\u0431\u043b\u0438\u043e\u0442\u0435\u043a\u0435, \u0441\u043e\u0441\u0442\u043e\u0438\u0442 \u0438\u0437 346\xbd \u0444\u043e\u043b\u0438\u043e (694 \u0441\u0442\u0440\u0430\u043d\u0438\u0446) \u0440\u0430\u0437\u043c\u0435\u0440\u043e\u043c \u043f\u0440\u0438\u043c\u0435\u0440\u043d\u043e 38,1 \xd7 34,5 \u0441\u043c."},
gSG(){return"\u0420\u0443\u043a\u043e\u043f\u0438\u0441\u044c \u0432\u044b\u043f\u043e\u043b\u043d\u0435\u043d\u0430 \u0432 \u0444\u043e\u0440\u043c\u0430\u043b\u044c\u043d\u043e\u043c \u0443\u043d\u0446\u0438\u0430\u043b\u044c\u043d\u043e\u043c \u043f\u043e\u0447\u0435\u0440\u043a\u0435 (\u0431\u0438\u0431\u043b\u0435\u0439\u0441\u043a\u0430\u044f \u043c\u0430\u044e\u0441\u043a\u0443\u043b) \u043d\u0430 \u0433\u0440\u0435\u0447\u0435\u0441\u043a\u043e\u043c \u044f\u0437\u044b\u043a\u0435, \u0441 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d\u0438\u0435\u043c scriptio continua (\u0431\u0435\u0437 \u043f\u0440\u043e\u0431\u0435\u043b\u043e\u0432 \u043c\u0435\u0436\u0434\u0443 \u0441\u043b\u043e\u0432\u0430\u043c\u0438). \u0422\u0435\u043a\u0441\u0442 \u0440\u0430\u0441\u043f\u043e\u043b\u043e\u0436\u0435\u043d \u0432 \u043a\u043e\u043b\u043e\u043d\u043a\u0430\u0445: \u0447\u0435\u0442\u044b\u0440\u0435 \u043a\u043e\u043b\u043e\u043d\u043a\u0438 \u043d\u0430 \u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0443 \u0432 \u041d\u043e\u0432\u043e\u043c \u0417\u0430\u0432\u0435\u0442\u0435 \u0438 \u0434\u0432\u0435 \u2013 \u0432 \u043f\u043e\u044d\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u0442\u0435\u043a\u0441\u0442\u0430\u0445 \u0412\u0435\u0442\u0445\u043e\u0433\u043e \u0417\u0430\u0432\u0435\u0442\u0430. \u0412 \u043a\u043e\u0434\u0435\u043a\u0441\u0435 \u0442\u0449\u0430\u0442\u0435\u043b\u044c\u043d\u043e \u0432\u044b\u0432\u0435\u0440\u0435\u043d\u044b \u0440\u0430\u0437\u0440\u044b\u0432\u044b \u0441\u0442\u0440\u043e\u043a, \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u044e\u0442\u0441\u044f nomina sacra \u0438 \u0441\u043f\u0435\u0446\u0438\u0444\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043f\u0443\u043d\u043a\u0442\u0443\u0430\u0446\u0438\u044f."},
