gSE(){return"\u041a\u043e\u0434\u0435\u043a\u0441 \u0431\u0443\u043b\u043e \u0432\u0438\u044f\u0432\u043b\u0435\u043d\u043e 1844 \u0440\u043e\u043a\u0443 \u0432 \u043c\u043e\u043d\u0430\u0441\u0442\u0438\u0440\u0456 \u0421\u0432\u044f\u0442\u043e\u0457 \u041a\u0430\u0442\u0435\u0440\u0438\u043d\u0438 \u043d\u0430 \u0421\u0438\u043d\u0430\u0439\u0441\u044c\u043a\u043e\u043c\u0443 \u043f\u0456\u0432\u043e\u0441\u0442\u0440\u043e\u0432\u0456 \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043c \u0444\u043e\u043d \u0422\u0456\u0448\u0435\u043d\u0434\u043e\u0440\u0444\u043e\u043c."},
